import React from "react";
import { Accordion } from "react-bootstrap";
import Task from "./Task";

const Category = (props) =>{
    return(
        <Accordion defaultActiveKey="0" className="w-100">
            {(Object.keys(props.data)).map((category, index, arr)=>{
                return <Accordion.Item key={index} eventKey={index} className="w-100">
                            <Accordion.Header>{ category === "any" ? "Задачи без категории" : category}</Accordion.Header>
                            <Accordion.Body>
                            {Object.keys(props.data[category]).map((task, index) => {
                                    return <Task key={index} item={task} done={props.data[category][task]} />
                                })}
                            </Accordion.Body>
                        </Accordion.Item>
            })}
        </Accordion>
    )
}

export default Category;
